import React from 'react'
import './MainPage.css'
import { Link, NavLink } from 'react-router-dom';
import Header from '../header/Header.js'

function MainPage() {
    return (
        <div>
            <Header />
            <Link className='button' to='/lost/'>Lost</Link>
            <Link className='button' to='/found/'>Found</Link>
        </div>
    );
}

export default MainPage;
